  useEffect(()=>{
    const fetchNotification =async ()=>{
      const response = await fetch('http://localhost:4000/getNotifications')
      const json = await response.json()
      if(response.ok){
        setNotification(json)
      }
    }
  },[])
  return (
    <div className='home'>
        
    </div>
  )
}

